query timesheets_by_period($period: String!) {
  timesheets(where: {working_date: {_eq: $period}}) {
    id
    client_id
    client {
      name
    }
  	project_task_id
    projects_task {
      task_description
      project_id
      project {
        name
        description
      }
    }
    created_at
    updated_at
    working_date
    working_durations
  }
}
```

